Blocks #76

Hi all,

I was looking at the performance impact of mxbeans in trace compass logging.


I ran the following code to test, once with mxbeans enabled, once without.

```java
 /**
 * Test Marker
 */
@Test
public void testPerformance() {
    Logger logger = fLogger;

    assertNotNull(logger);
    try (ScopeLog sl = new ScopeLog(logger, Level.WARNING, "Outer")) {
        for (int i = 0; i < 100000; i++) {
            new Object();
        }
    }
    fStreamHandler.flush();
    Logger nullLogger = Logger.getAnonymousLogger();
    for (Handler hander : nullLogger.getHandlers()) {
        nullLogger.removeHandler(hander);
    }
    try (ScopeLog sl = new ScopeLog(logger, Level.WARNING, "Outer")) {
        for (int i = 0; i < 100000; i++) {
            try (ScopeLog nl = new ScopeLog(nullLogger, Level.FINE, "inner")) {
                        new Object();
            }
        }
    }
    try (ScopeLog sl = new ScopeLog(logger, Level.WARNING, "Outer")) {
        for (int i = 0; i < 100000; i++) {
            try (ScopeLog nl = new ScopeLog(nullLogger, Level.FINE, "inner")) {
                        new Object();
            }
        }
    }
    System.out.println(fLog.getMessages().get(0));
}
```
On an 11th Gen Intel(R) Core(TM) i5-1145G7 @ 2.60GHz, the following results were obtained.

The test ran, the first pass took ~ 262.1 ns per iteration. The second pass took 526.7 ns/iteration. Removing mxbeans made the second pass take 334.3 ns/cycle. 

| Configuration   | Total Time     | Tracing impact |
|-----------------|----------------|----------------|
| No tracing      | 262.1 ns/event | 0              |
| Tracing         | 334.3 ns/event | 72.1 ns/scope  |
| Tracing+mxbeans | 526.7 ns/event | 264.6 ns/scope |

I would propose making the beans an optional item. The overhead is low but non-null. This choice can be given to the user.
